import React from 'react';
import { Link } from 'react-router-dom';
import useAuth from '../../hooks/Authcontext';


const Login = () => {
    const {signinUsingGoogle,GithubSignin}=useAuth()
    return (
        <div>
            <h2>Please Login</h2>
            <button onClick={signinUsingGoogle}>Google Log In</button>
            <br />
            <br />
            <button onClick={GithubSignin}>Github SignIn</button>
            <br />
            <br />

            <Link to='/register'>New User??Please Register Here</Link>
        </div>
    );
};

export default Login;
